import React, { useState } from 'react';
const Forecast = () => {
    let [responseObj, setResponseObj] = useState({});
    function getForecast() {
        fetch("https://community-open-weather-map.p.rapidapi.com/weather?callback=test&id=2172797&units=%2522metric%2522%20or%20%2522imperial%2522&mode=xml%252C%20html&q=Washington", {
            "method": "GET",
            "headers": {
                "x-rapidapi-host": "community-open-weather-map.p.rapidapi.com",
                "x-rapidapi-key": "d9cb56b47fmsh7c0659317c13d37p1db628jsn2f72e66714c8"
            }
        }).then(response => response.json())
        .then(response => {
            setResponseObj(response)
        })
            // .then(response => {
            //     console.log(response);
            // })
            // .catch(err => {
            //     console.log(err);
            // });
    }
    return (
        <div>
            <h2>Find Current Weather Conditions</h2>
            <div> {
                JSON.stringify(responseObj)
            } </div>
            <button onClick={getForecast}>Get Forecast</button>
        </div>
    )
}
export default Forecast;
